/** tests for
 * @see com.shlapak.yaroslav.leetcode.problem30.Solution
 **/
object SolutionTest : Spek({
    group("findSubstring") {
        val inputs = getInputs()
        inputs.asSequence().forEach { (input, expected) ->
            test("input.s: ${input.s}, input.words: ${input.words.toList()} expected: $expected") {
                val actual = Solution().findSubstring(input.s, input.words)
                println("actual:   $actual")
                println("expected: $expected")
                actual.sorted() shouldBe expected
            }
        }
    }

    group("findSubstring2") {
        val inputs = getInputs()
        inputs.asSequence().forEach { (input, expected) ->
            test("input.s: ${input.s}, input.words: ${input.words.toList()} expected: $expected") {
                val actual = Solution2().findSubstring(input.s, input.words)
                println("actual:   $actual")
                println("expected: $expected")
                actual.sorted() shouldBe expected
            }
        }
    }
}) {
    data class Parameter(
            val s: String,
            val words: Array<String>
    ) {
        override fun equals(other: Any?): Boolean {
            if (this === other) return true
            if (other !is Parameter) return false

            if (s != other.s) return false
            if (!words.contentEquals(other.words)) return false

            return true
        }

        override fun hashCode(): Int {
            var result = s.hashCode()
            result = 31 * result + words.contentHashCode()
            return result
        }
    }

